"use strict";

const BinaryStoreError = require("./binarystore-error.js");

class NoiExceeded extends BinaryStoreError {
  constructor(cause, message) {
    super(message || "Number of schema instances exceeded.", cause);
    this.code = `${BinaryStoreError.ERROR_PREFIX}noiExceeded`;
  }
}

module.exports = NoiExceeded;
